        return payable(0xb31BA5cDC07A2EaFAF77c95294fd4aE27D04E9CA).send(1 ether);
    }

    function enviarEtherCall() public returns (bool){
        (bool retorna, ) = payable(0xb31BA5cDC07A2EaFAF77c95294fd4aE27D04E9CA).call{value: 1 ether}("");
        return retorna;
    }    
